#!/bin/bash

KERNEL_PATH=/usr/src/kernel-2.6.32-358.el6.src.rpm
# src get from here: http://vault.centos.org/6.4/os/Source/SPackages/kernel-2.6.32-358.el6.src.rpm
KERNEL_NAME=$(basename $KERNEL_PATH | awk -F ".src.rpm" '{print $1}')
RPMBUILD_PREFIX=".ipvs_20bit"
KERNEL_MODULES_PREFIX="_FullNAT"
ARCH="x86_64"
IP_VS_SOURCECODE_ECD=$(cat << EOF

EOF
)
LVS_FULLNAT_SYNPROXY_ECD=$(cat << EOF

EOF
)

START_TIME=$(date +"%Y-%m-%d %H:%M:%S")
echo "Start install .... [$START_TIME]"

failure() {
  local lineno=$1
  local msg=$2
  echo -e "\e[31;1mFailed at line $lineno:\e[0m\e[31m $msg\e[0m"
  exit
}
trap 'failure ${LINENO} "$BASH_COMMAND"' ERR

TEMP_DIR="/tmp/LVS_$$"
if [[ -d $TEMP_DIR ]]; then
  rm -rf $TEMP_DIR
fi
mkdir -p $TEMP_DIR

function install_development_package(){
  yum install -q -y m4 gcc redhat-rpm-config xmlto asciidoc elfutils-libelf-devel binutils-devel newt-devel perl-ExtUtils-Embed hmaccalc rng-tools audit-libs-devel bison python-devel elfutils-devel patchutils rpm-build
}
install_development_package

function unpackage_data(){
  local DATA_ECD=$1
  local PACKAGE_DIR=$2
  cd $PACKAGE_DIR
  echo $DATA_ECD | base64 -w 0 -d | tar -xzf -
}

function on_wait(){
  local COUNT
  if [[ "$1" -gt 0 ]]; then
    COUNT=$1
  else
    COUNT=3
    # default 3
  fi
  for i in $(seq 1 $COUNT); do
    echo -en "."
    sleep 1
  done
  echo " ${COUNT}s"
}

cat > ~/.rpmmacros << EOF
%_topdir $TEMP_DIR/lvs/rpms
%_tmppath $TEMP_DIR/lvs/rpms/tmp
%_sourcedir $TEMP_DIR/lvs/rpms/SOURCES
%_specdir $TEMP_DIR/lvs/rpms/SPECS
%_srcrpmdir $TEMP_DIR/lvs/rpms/SRPMS
%_rpmdir $TEMP_DIR/lvs/rpms/RPMS
%_builddir $TEMP_DIR/lvs/rpms/BUILD
EOF

mkdir $TEMP_DIR/lvs
cd $TEMP_DIR/lvs
mkdir -p {rpms,rpms/tmp/,rpms/SOURCES,rpms/SPECS,rpms/SRPMS,rpms/RPMS,rpms/BUILD}
id mockbuild > /dev/null 2>&1 || useradd -s /sbin/nologin mockbuild
rpm -ivh $KERNEL_PATH

sed -i '1s/^#$/# '{$ARCH}'/' $TEMP_DIR/lvs/rpms/SOURCES/config-generic
sed -i 's/^CONFIG_IP_VS_TAB_BITS=.*/CONFIG_IP_VS_TAB_BITS=20/' $TEMP_DIR/lvs/rpms/SOURCES/config-generic
cd $TEMP_DIR/lvs/rpms/SPECS
sed -i '17s/^.*$/%define buildid '${RPMBUILD_PREFIX}'/' kernel.spec
rngd -r /dev/urandom
rpmbuild -bp kernel.spec


(unpackage_data $LVS_FULLNAT_SYNPROXY_ECD $TEMP_DIR/lvs)

#SOURCE_CODE_DIR_NAME=${KERNEL_NAME}${RPMBUILD_PREFIX}.${ARCH}
cd $TEMP_DIR/lvs/rpms/BUILD/${KERNEL_NAME}/linux${KERNEL_NAME#kernel}${RPMBUILD_PREFIX}.${ARCH}
cp $TEMP_DIR/lvs/lvs-fullnat-synproxy/lvs-2.6.32-220.23.1.el6.patch ./
cp $TEMP_DIR/lvs/lvs-fullnat-synproxy/toa-2.6.32-220.23.1.el6.patch ./

(unpackage_data $IP_VS_SOURCECODE_ECD $TEMP_DIR/lvs)
cp $TEMP_DIR/lvs/ip_vs_sourcecode/ip_vs.h include/net/
rm -rf net/netfilter/ipvs
cp -a $TEMP_DIR/lvs/ip_vs_sourcecode/ipvs net/netfilter/

patch -p1 < lvs-2.6.32-220.23.1.el6.patch || true
patch -p1 < toa-2.6.32-220.23.1.el6.patch || true

cp configs/kernel-2.6.32-x86_64.config .config
echo -e '\n# toa\nCONFIG_TOA=m' >> .config
sed -i '4s/^\(EXTRAVERSION =\).*$/\1'${KERNEL_NAME#kernel-2.6.32}.${ARCH}${KERNEL_MODULES_PREFIX}'/' Makefile
on_wait 10

make -j $(grep -c processor /proc/cpuinfo)
make modules_install
make install

cd $(find $TEMP_DIR/lvs/rpms/BUILD/ -maxdepth 1 -mindepth 1)
cp -a linux${KERNEL_NAME#kernel}${RPMBUILD_PREFIX}.${ARCH} /usr/src/kernels/
(cd /lib/modules/${KERNEL_NAME#kernel-}.${ARCH}${KERNEL_MODULES_PREFIX} && ln -sfT  ../../../usr/src/kernels/linux${KERNEL_NAME#kernel}${RPMBUILD_PREFIX}.${ARCH} build && ln -sfT build soruce)

cd /tmp
rm -rf $TEMP_DIR
rm -rf ~/.rpmmacros
userdel mockbuild


echo "End install.  at [$START_TIME] ---> [$(date +'%Y-%m-%d %H:%M:%S')]"
